import React,{useEffect} from 'react'
import { VideoPreview } from './VideoPreview';

export function VideoList({ list, setCurrVideo }) {

    useEffect(() => {
        window.add
    }, [])

    return (
        <div className="video-list">
            {list.map(video => {
                return <VideoPreview
                    video={video}
                    key={video.id.videoId}
                    setCurrVideo={setCurrVideo} />
            })}
        </div>
    )
}
